import React from "react";
import './Hero.css';

const Hero = () => {
    return (
        <div className='hero'>
            <div className='hero-left'></div>
            <h2>Feautured</h2>
            <p>wear your own style</p>
            <div className="hero-latest-btn">
                <div>Latest Collection</div>
            </div> // Added closing tag for the 'div' element
            <div className="hero-right"></div>
        </div>
    );
}

export default Hero;
